import './App.css';
import hotelpool from "./images/hotel_pool.jpg";

function App() {
  return (
    <div className="App">
      <div className="Header">
        <h1>HotelsNOW</h1>
          <ul>
            <li><a href="#">Home</a></li>
            <li><a href="#">Our Services</a></li>
            <li><a href="#">About Us</a></li>
            <li><a href="#">Blog</a></li>
            <li><a href="#">Contact us</a></li>
            <li><a href="#" className="book">Book Now</a></li>
          </ul>
      </div>

      <div className="Intro">
        <img src={hotelpool}/>
        <p>Your home away from home</p>
        <p>Where Comfort and Affordability meet</p>
        <a href="#" className="book">Explore now</a>
      </div>
    </div>
  );
}

export default App;
